DROP TABLE IF EXISTS `a_pay_order`;
CREATE TABLE `a_pay_order` (
  `poid` varchar(64) NOT NULL COMMENT '订单ID',
  `platformorders` varchar(64) DEFAULT NULL,
  `uiid` bigint(20) DEFAULT NULL COMMENT '用户ID',
  `paytyple` int(2) DEFAULT NULL COMMENT '收支类型 0 充值 1 提现',
  `ordertype` int(4) DEFAULT '0' COMMENT '订单类型根据字典表延伸',
  `ppid` bigint(20) DEFAULT NULL COMMENT '支付平台信息ID',
  `paymethods` int(2) DEFAULT NULL COMMENT '存提款方式 0公司入款，1第三方支付',
  `bankname` varchar(64) DEFAULT NULL COMMENT '银行名称',
  `bankcard` varchar(64) DEFAULT NULL COMMENT '银行卡号',
  `openname` varchar(20) DEFAULT NULL COMMENT '开户姓名',
  `deposit` varchar(64) DEFAULT NULL COMMENT '存款分行',
  `deposittime` datetime DEFAULT NULL COMMENT '存款时间',
  `amount` decimal(10,2) DEFAULT NULL COMMENT '金额',
  `paystatus` int(2) DEFAULT '0' COMMENT '第三方支付专用支付状态（0支付中，其它已支付）',
  `status` int(2) DEFAULT NULL COMMENT '状态 0 作废 1 发起（待财务审核） 2 处理中（待客服核实） 3 存取成功 4 存取失败',
  `remarks` varchar(120) DEFAULT '' COMMENT '备注',
  `ordercontent` varchar(200) DEFAULT NULL COMMENT '订单明细',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `uaccount` varchar(64) DEFAULT NULL COMMENT '会员账号',
  `urealname` varchar(64) DEFAULT NULL COMMENT '会员姓名',
  `kfremarks` varchar(200) DEFAULT NULL COMMENT '客服备注',
  `kfid` bigint(20) DEFAULT NULL COMMENT '客服ID',
  `kfname` varchar(64) DEFAULT NULL COMMENT '客服名称',
  `kfopttime` datetime DEFAULT NULL COMMENT '客服操作时间',
  `cwremarks` varchar(200) DEFAULT NULL COMMENT '财务备注',
  `cwid` bigint(20) DEFAULT NULL COMMENT '财务ID',
  `cwname` varchar(64) DEFAULT NULL COMMENT '财务名称',
  `cwopttime` datetime DEFAULT NULL COMMENT '财务操作时间',
  `beforebalance` decimal(10,2) DEFAULT '0.00' COMMENT '操作前余额',
  `laterbalance` decimal(10,2) DEFAULT '0.00' COMMENT '操作后余额',
  `hdnumber` varchar(32) DEFAULT NULL COMMENT '活动编号，如果不为空表示用户已参加活动',
  `ordernumber` varchar(32) DEFAULT NULL COMMENT '订单号',
  `proxy_name` varchar(64) DEFAULT NULL COMMENT '所属代理',
  `channel` int(2) DEFAULT NULL COMMENT '渠道',
  PRIMARY KEY (`poid`),
  KEY `uaccount_index` (`uaccount`) USING BTREE,
  KEY `deposittime_index` (`deposittime`) USING BTREE,
  KEY `uiid_index` (`uiid`) USING BTREE,
  KEY `kf_index` (`kfremarks`) USING BTREE,
  KEY `cw_index` (`cwremarks`) USING BTREE,
  KEY `indexpaytype` (`paytyple`,`status`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单明细';

