  `clearingid` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '记录ID',
  `uiid` int(11) DEFAULT NULL COMMENT '对应用户ID',
  `clearingAmount` decimal(10,2) DEFAULT NULL COMMENT '结算金额=实际盈亏*结算比例',
  `clearingScale` varchar(32) DEFAULT NULL COMMENT '结算比例',
  `finalamountTotal` varchar(32) DEFAULT NULL COMMENT '盈亏',
  `validBetAmountTotal` varchar(32) DEFAULT NULL COMMENT '总有效投注',
  `ximaAmount` varchar(32) DEFAULT NULL COMMENT '下线会员本月总洗码',
  `preferentialTotal` varchar(32) DEFAULT NULL COMMENT '下线会员本月总优惠',
  `realPL` varchar(32) DEFAULT NULL COMMENT '实际盈亏=结算总盈亏-(本月总洗码+本月总优惠)',
  `clearingType` int(11) DEFAULT NULL COMMENT '结算类型（0：输值结算按月 1：按月洗码 2：按天洗码）',
  `clearingStatus` int(11) DEFAULT NULL COMMENT '入账状态（0：未入账 1：已入账 2:记录，用于累计代理盈亏 3:撤除记录 4:未分配，表现给代理洗码后，需要代理分配给下线 5:已分配，可以入账 6:洗码记录）',
  `clearingTime` datetime DEFAULT NULL COMMENT '结算日期',
  `clearingStartTime` datetime DEFAULT NULL COMMENT '结算注单开始日期',
  `clearingEndTime` datetime DEFAULT NULL COMMENT '结算注单结束日期',
  `clearingRemark` varchar(100) DEFAULT NULL COMMENT ' 备注',
  `upuser` varchar(32) DEFAULT NULL COMMENT '入账操作人',
  `uptime` datetime DEFAULT NULL COMMENT '入账时间',
  `upclient` varchar(32) DEFAULT NULL COMMENT '入账客户端IP',
  PRIMARY KEY (`clearingid`),
  KEY `clearingTime_index` (`clearingTime`) USING BTREE,
  KEY `clearingStatus_index` (`clearingStatus`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

