  `QQ` varchar(25) DEFAULT NULL COMMENT 'QQ',
  `birthday` varchar(14) DEFAULT NULL COMMENT '生日',
  `grade` int(2) DEFAULT NULL COMMENT '会员等级 1等级 2等级 3等级 4等级 5等级',
