  `uloginip` varchar(32) DEFAULT NULL,
  `logincount` int(10) DEFAULT '0',
  `typeflag` int(11) DEFAULT '1' COMMENT '0：线下会员 1:线上会员',
  `apipassword` varchar(100) DEFAULT NULL,
  `phonevalid` int(2) DEFAULT '0' COMMENT '电话号码验证 0：无效  1：有效',
  `emailvalid` int(2) DEFAULT '0' COMMENT '电子邮件认证0：未认证1已认证',
  `clientflag` int(2) DEFAULT '0' COMMENT '0:维护客户，1：开发客户',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  `relaaccount` text COMMENT '关联账号',
  `relaflag` char(1) DEFAULT '0' COMMENT '是否有关联账号  0:无  1:有',
  `iparea` varchar(64) DEFAULT NULL COMMENT 'IP区域',
  `phonearea` varchar(64) DEFAULT NULL COMMENT '电话区域',
  `regdevice` varchar(1024) DEFAULT NULL COMMENT '注册客户端信息',
  `weekrake` char(2) DEFAULT '1' COMMENT '周返水开关 0:关闭 1:打开',
  `platforms` varchar(32) DEFAULT NULL COMMENT '游戏平台名称',
  `spread` varchar(32) DEFAULT NULL COMMENT '推广Id',
  `dayrake` char(2) DEFAULT '1' COMMENT '日返水',
  `activityflag` char(2) DEFAULT '1' COMMENT '是否参加活动',
  `wechat` varchar(32) DEFAULT NULL COMMENT '微信账号',
  PRIMARY KEY (`uiid`,`account`),
  UNIQUE KEY `account_index` (`account`) USING BTREE,
  KEY `sous_index` (`uname`,`phone`,`email`,`QQ`,`regip`,`create_date`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=670 DEFAULT CHARSET=utf8 COMMENT='用户信息表';

